import React, { useState } from 'react';
import Button from '@mui/material/Button';
import InboxIcon from '@mui/icons-material/Inbox';
import Box from '@mui/material/Box';
import Modal from '@mui/material/Modal';
import Grid from '@mui/material/Grid';
import TableFornecedores from './tables/TableFornecedores';
import Input from '@mui/material/Input';

const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  bgcolor: 'background.paper',
  boxShadow: 24,
  pt: 2,
  px: 4,
  pb: 3,
};

export default function ButtonDespesa() {
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };
  const [name, setValor] = useState('');
  const handleChange = (event) => {
    setValor(event.target.value);
  };
  return (
    <div>
    <Button variant="contained" color='secondary' onClick={handleOpen} startIcon={<InboxIcon />}>Despesas</Button>
      <Modal
          open={open}
          onClose={handleClose}
          aria-labelledby="parent-modal-title"
          aria-describedby="parent-modal-description"
        >
        <Box sx={{ ...style, width: 400, height: 450 }}>
          <Grid container direction="row" justifyContent="space-between" alignItems="center">
            <h2 id="parent-modal-title">Itens</h2>
            <CadastroModal />
          </Grid>
          <TableFornecedores />
          <Grid
          sx={{mt:2}}
            container
            direction="row"
            justifyContent="flex-end"
            alignItems="flex-end"
          >
            <Button variant="outlined" color="secondary" onClick={handleClose}>Fechar</Button>
          </Grid>
        </Box>
      </Modal>
    </div>
  );
}
